		"text": "시각장애인, 난독증, 인지장애인 등 다양한 사람들이 화면판독기(Screen Reader)를 통해 음성으로 낭독하는 것을 듣게 되는데 인스타그램 폰트라고 불리는 유니코드 문자 폰트를 사용하면 이를 건너뛰거나 제대로 읽지 못하기 때문. \n\n#접근성 #Accessibility \n#스크린리더 #ScreenReader #화면판독기"
